import React from 'react';
 function Cards()
 {
     return(  
         <>
       <div className="cards"> 
       <div className="card"> 
             <img src="extraction.jpg" alt= "netflix baner"  className="card_img"/>
             <div className="card_info">
               <span className="card_category">A netflix orignal series.</span>  
              <h3 className="card_title">EXTENTION</h3>
              <a href="https://www.netflix.com/in/title/80230399" target="blank">
                  <button>Watch Now</button>
              </a>            
             </div>
            </div>
           </div>

         </>
     );
// return <h3>hello card</h3>; 
}
 export default Cards;
